import styled from "styled-components";

export const SideBarContainer = styled.div`
  display: flex;
  flex-direction: column;
  background-color: black;
  height: 100vh;
  width: 7%;
  border-top-right-radius: 15px;
  border-bottom-right-radius: 15px;
  padding: 20px;

  .home-icon {
    margin-bottom: 120%;
  }
`;
